INSERT INTO `core_posts` VALUES ('15', '1', '2014-08-07 14:16:49', '2014-08-07 07:16:49', '<h3 id=\"dropdowns-alignment\">22Alignment</h3>\r\n<p>By default, a dropdown menu is automatically positioned 100% from the top and along the left side of its parent. Add&nbsp;<code>.dropdown-menu-right</code>&nbsp;to a&nbsp;<code>.dropdown-menu</code>&nbsp;to right align the dropdown menu.</p>\r\n<div class=\"bs-callout bs-callout-warning\">\r\n<h4>May require additional positioning</h4>\r\n<p>Dropdowns are automatically positioned via CSS within the normal flow of the document. This means dropdowns may be cropped by parents with certain&nbsp;<code>overflow</code>&nbsp;properties or appear out of bounds of the viewport. Address these issues on your own as they arise.</p>\r\n</div>\r\n<div class=\"bs-callout bs-callout-warning\">\r\n<h4>Deprecated&nbsp;<code>.pull-right</code>&nbsp;alignment</h4>\r\n<p>As of v3.1.0, we\'ve deprecated&nbsp;<code>.pull-right</code>&nbsp;on dropdown menus. To right-align a menu, use&nbsp;<code>.dropdown-menu-right</code>. Right-aligned nav components in the navbar use a mixin version of this class to automatically align the menu. To override it, use<code>.dropdown-menu-left</code>.</p>\r\n<p class=\"gallerybox_center\" align=\"center\"><a class=\"thickbox cboxElement\" title=\"\" href=\"http://www.i3.in.th/gallery/content/16/7667_IMG_20130808_111106_resize_1.jpg\" rel=\"7667\"><img src=\"http://www.i3.in.th/gallery/content/16/7667_IMG_20130808_111106_resize_1.jpg\" alt=\"\" /></a></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; สวัสดีครับ เมื่อเช้าวันนี้ทาง HP ได้ทำการเปิดตัวทั้ง แทบเล็ต, โน้ตบุ๊คกึ่งแทบเล็ต และ ออลอินวันพีซี ที่ใช้งานด้วยระบบปฏิบัติการแอนดรอยด์ อันได้แก่ HP Slate 7, HP SlateBook 10 X2 และ HP Slate&nbsp;<sup>21&nbsp;</sup>All-in-One &nbsp;ซึ่งผมได้มีโอกาสได้ลองทดสอบ 1 รุ่นก่อนที่จะได้มารีวิวแบบฉบับเต็มกันก่อนนั่นก็คือเจ้า HP Slate<sup>21&nbsp;</sup>All-in-One &nbsp;ว่าแล้วมาดูกันก่อนเลยครับว่าเป็นอย่างไรบ้าง</p>\r\n</div>', '[Mini-Review] HP Slate 21 แรงสุดด้วย Tegra4 มีผลทดสอบ พร้อมราคาแค่ 11,990 บาท', '', 'draft', 'open', 'open', '', '[mini-review]-hp-slate-21-แรงสุดด้วย-tegra4-มีผลทดสอบ-พร้อมราคาแค่-11,990-บาท', '', '', '2016-03-22 15:27:06', '2016-03-22 08:27:06', '', '0', '', '0', 'post', '', '0');
