INSERT INTO `core_posts` VALUES ('92', '1', '2016-03-22 12:45:34', '2016-03-22 05:45:34', '<p>With Bootstrap 2, we added optional mobile friendly styles for key aspects of the framework. With Bootstrap 3, we\'ve rewritten the project to be mobile friendly from the start. Instead of adding on optional mobile styles, they\'re baked right into the core. In fact,<strong>Bootstrap is mobile first</strong>. Mobile first styles can be found throughout the entire library instead of in separate files.</p>\r\n<p>To ensure proper rendering and touch zooming, <strong>add the viewport meta tag</strong> to your <code>&lt;head&gt;</code>.</p>\r\n<div class=\"zero-clipboard\"><span class=\"btn-clipboard\">Copy</span></div>\r\n<figure class=\"highlight\">\r\n<pre><code class=\"language-html\" data-lang=\"html\"><span class=\"nt\">&lt;meta</span> <span class=\"na\">name=</span><span class=\"s\">\"viewport\"</span> <span class=\"na\">content=</span><span class=\"s\">\"width=device-width, initial-scale=1\"</span><span class=\"nt\">&gt;</span></code></pre>\r\n</figure>\r\n<p>You can disable zooming capabilities on mobile devices by adding <code>user-scalable=no</code> to the viewport meta tag. This disables zooming, meaning users are only able to scroll, and results in your site feeling a bit more like a native application. Overall, we don\'t recommend this on every site, so use caution!</p>\r\n<div class=\"zero-clipboard\"><span class=\"btn-clipboard\">Copy</span></div>\r\n<figure class=\"highlight\">\r\n<pre><code class=\"language-html\" data-lang=\"html\"><span class=\"nt\">&lt;meta</span> <span class=\"na\">name=</span><span class=\"s\">\"viewport\"</span> <span class=\"na\">content=</span><span class=\"s\">\"width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no\"</span><span class=\"nt\">&gt;</span></code></pre>\r\n</figure>', 'Mobile first', '', 'publish', 'open', 'open', '', 'sdmonkddd', '', '', '2016-03-22 12:45:34', '2016-03-22 05:45:34', '', '0', '', '0', 'page', '', '0');
